import { Fragment } from "react";
import Header from ".components/Layout/Header";
import Meals from "./Meals/Meals";
import Cart from "./components/Cart/Cart";

function App() {
  return (
   <Fragment>
   <Cart />
    <Header />
    <main>
      <Meals />
    </main>
   </Fragment>
  )
}

export default App;
